<div className="Supervisor-Card">
<button className="button-Add-Supervisor"> للمزيد من المعلومات </button>
<p className="p-Supervisor-Card">
{+card.Opport_name}  
<br />
<br />
   {card.Description+" : الوصف "}
</p>
</div>

  )
}

